import React from "react";
import {getFetch} from "../function/fetch";
import {Select} from "antd";

export default class TicketInfoPage extends React.Component {
    constructor() {
        super();
        this.state = {
            data: null
        }
    }

    componentDidMount() {
        getFetch("/order/selfOrder?userId="+localStorage.getItem('id'),"",(rsp)=>{
            this.setState({
                data:rsp
            })
            console.log(rsp);
        })
    }
}
